import React, { Component } from "react";
import "./App.css";
import Market from "./component/Market";
import Sell from "./component/Sell";
import Buy from "./component/Buy";

class App extends Component {
  render() {
    return (
      <div>
        <Market />
        <center>
        <img src="https://i0.wp.com/coinvestasi.com/wp-content/uploads/2019/08/LOGO-INDODAX-NewTagline2020.png?fit=1200%2C280&ssl=1" alt="" width="1000px"/>
        </center>
        <div class="row">
          <div class="column">
            <Sell />
          </div>
          <div class="column">
            <Buy />
          </div>
        </div>
        <br/><br/><br/><br/>
      </div>
    );
  }
}
export default App;
